import './App.css';
import { ThemeProvider, Box } from '@mui/system';
import { theme } from './themes/theme';

import Header from './components/Header';
import Footer from './components/Footer';
import Profile from './components/Profile';
import Resume from './pages/Resume';

function App() {
  return (
    //<ThemeProvider theme={theme}>
      <Box
        sx={{
          display: 'grid',
          gridTemplateColumns: 'repeat(4, 1fr)',
          gap: 1,
          gridTemplateRows: 'auto',
          gridTemplateAreas: `"profile header header header"
        "profile resume"
        "profile footer footer footer"`,
        }}
      >
        <Box sx={{ gridArea: 'header'}} component={Header} />
        <Box sx={{ gridArea: 'profile'}} component={Profile} />
        <Box sx={{ gridArea: 'resume'}} component={Resume} />
        <Box sx={{ gridArea: 'footer'}} component={Footer} />
      </Box>
    //</ThemeProvider>
  );
}

export default App;
